import React from 'react';
import s from './bag.module.css'

const Bag = (props) => {
    return (
        <div className={s.grid}>
            <div className={s.grid1}>
dddd
            </div>
            <div className={s.grid2}>
sss
            </div>
        </div>
    )
}
export default Bag;
